import React from "react";

class Area extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      areas: [
        { id: 0, title: "서울", area: "서울" },
        { id: 1, title: "경기", area: "경기" },
        { id: 2, title: "인천", area: "인천" },
        { id: 3, title: "강원", area: "강원" },
      ],
    };
  }

  render() {
    var data = this.state.areas;
    var i = 0;
    var list = [];
    while (i < data.length) {
      list.push(
        <li key={data.id}>
          <a
            href={"/area/" + data[i].id}
            onclick={function (id, e) {
              e.preventDefault();
              this.props.onSlected(id);
            }.bind(this)}
          >
            {list[i].area}
          </a>
        </li>
      );
      i = i + 1;
    }
    return (
      <div>
        <ol>{data}</ol>
      </div>
    );
  }
}

export default Area;
